  false,\n\t\"url\": null,\n\t\"notes\": \"Bathymetry of Lake Huron has been compiled
  as a component of a NOAA project to rescue Great Lakes lake floor geological and
  geophysical data and make it more accessible. This project is a cooperative effort
  between investigators at the NOAA National Geophysical Data Center's Marine Geology
  and Geophysics Division (NGDC/MGG), the NOAA Great Lakes Environmental Research
  Laboratory (GLERL) and the Canadian Hydrographic Service(CHS). Bathymetric data
  have been collected from the Great Lakes in support of nautical charting for at
  least 150 years by the US Army Corp. of Engineers (before 1970), the NOAA National
  Ocean Service (NOS)(after 1970), and the Canadian Hydrographic Service.\",\n\t\"license_title\":
